import React from 'react';

function HomePage() {
  return (
    <div>
      <h1>Bienvenue sur notre site de cocktails !</h1>
      <p>Découvrez une sélection de délicieux cocktails et apprenez à les préparer vous-même. Que vous soyez un amateur de cocktails ou un barman professionnel, vous trouverez ici des recettes pour satisfaire votre soif de découverte et de créativité.</p>
    </div>
  );
}

export default HomePage;
